export default function App() {
  return (
    <div className="tips">
      <TipCalculator />
    </div>
  );
}

function TipCalculator() {
  return (
    <div>
      <BillInput />
      <SelectPercentage />
      <SelectPercentage />
      <Output />
      <Reset />
    </div>
  );
}

function BillInput() {
  return (
    <div>
      How much was the bill?
      <input type="text" />
    </div>
  );
}

function SelectPercentage() {
  return (
    <div>
      How did you like the service?
      <select>
        <option>It was ok (5%)</option>
        <option>It was good (10%)</option>
        <option>It was amazing (20%)</option>
      </select>
    </div>
  );
}

function Output() {
  return <h1>You pay $92 ($80 + $12 tip)</h1>;
}

function Reset() {
  return <button>Reset</button>;
}
